Z","iopub.status.busy":"2024-01-19T00:42:53.90741Z","iopub.status.idle":"2024-01-19T00:42:53.971686Z","shell.execute_reply":"2024-01-19T00:42:53.969964Z"},"papermill":{"duration":0.073522,"end_time":"2024-01-19T00:42:53.974538","exception":false,"start_time":"2024-01-19T00:42:53.901016","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["[1] \"Number of missing values in Salary: 0\"\n","[1] \"Number of non-finite values in Salary: 0\"\n"]}],"source":["# Removing commas in Salary\n","baseball_data$Salary <- as.numeric(gsub(\",\", \"\", baseball_data$Salary))\n","\n","# Check for missing or non-finite values in 'Salary'\n","missing_values <- sum(is.na(baseball_data$Salary))\n","finite_values <- sum(!is.finite(baseball_data$Salary))\n","\n","# Print the number of missing and non-finite values\n","print(paste(\"Number of missing values in Salary:\", missing_values))\n","print(paste(\"Number of non-finite values in Salary:\", finite_values))\n","\n","# Handle missing and non-finite values\n","baseball_data <- na.omit(baseball_data)"]},{"cell_type":"markdown","id":"ed68c952","metadata":{"papermill":{"duration":0.004579,"end_time":"2024-01-19T00:42:53.983718","exception":false,"start_time":"2024-01-19T00:42:53.979139","status":"completed"},"tags":[]},"source":["## Part 2\n","\n","Creating ANOVA table to determine significance of the independent factors position and team."]},{"cell_type":"code","execution_count":3,"id":"18056017","metadata":{"execution":{"iopub.execute_input":"2024-01-19T00:42:53.996448Z","iopub.status.busy":"2024-01-19T00:42:53.994924Z","iopub.status.idle":"2024-01-19T00:42:54.049605Z","shell.execute_reply":"2024-01-19T00:42:54.047686Z"},"papermill":{"duration":0.06352,"end_time":"2024-01-19T00:42:54.05187","exception":false,"start_time":"2024-01-19T00:42:53.98835","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["[1] \"ANOVA Table for Position:\"\n","             Df    Sum Sq   Mean Sq F value   Pr(>F)    \n","POS           9 3.327e+15 3.696e+14    9.06 6.31e-13 ***\n","Residuals   618 2.521e+16 4.080e+13                     \n","---\n","Signif. codes:  0 ‘***’ 0.001 ‘**’ 0.01 ‘*’ 0.05 ‘.’ 0.1 ‘ ’ 1\n","[1] \"ANOVA Table for Team:\"\n","             Df    Sum Sq   Mean Sq F value Pr(>F)  \n","Team         29 1.962e+15 6.767e+13   1.523 0.0404 *\n","Residuals   598 2.658e+16 4.444e+13                 \n","---\n","Signif. codes:  0 ‘***’ 0.001 ‘**’ 0.01 ‘*’ 0.05 ‘.’ 0.1 ‘ ’ 1\n"]}],"source":["# Create an ANOVA table for position\n","POS_aov <- aov(Salary ~ POS, data = baseball_data)\n","\n","# Display the ANOVA table for position\n","print(\"ANOVA Table for Position:\")\n","print(summary(POS_aov))\n","\n","# Create an ANOVA table for team\n","Team_aov <- aov(Salary ~ Team, data = baseball_data)\n","\n","# Display the ANOVA table for team\n","print(\"ANOVA Table for Team:\")\n","print(summary(Team_aov))"]},{"cell_type":"markdown","id":"9bfdce7e","metadata":{"papermill":{"duration":0.004906,"end_time":"2024-01-19T00:42:54.06166","exception":false,"start_time":"2024-01-19T00:42:54.056754","status":"completed"},"tags":[]},"source":["The first table, \"ANOVA Table for Position:\", the small p-value (6.31×10^−13) suggests that there are significant differences in salaries among different positions. Therefore, we can reject the null hypothesis that there are no significant differences in mean salaries between the positions. This implies that the 'Position' variable has a statistically significant effect on salaries. \n","\n","The second table, \"ANOVA Table for Team:\", the p-value (0.0404) is less than the significance level of 0.05, suggesting that there are significant differences in salaries among different teams. Therefore, we can reject the null hypothesis that there are no significant differences in mean salaries between the teams. This implies that the 'Team' variable has a statistically significant effect on salaries."]},{"cell_type":"markdown","id":"692235a6","metadata":{"papermill":{"duration":0.004763,"end_time":"2024-01-19T00:42:54.071144","exception":false,"start_time":"2024-01-19T00:42:54.066381","status":"completed"},"tags":[]},"source":["## Part 3\n","\n","In this part, we will create box plots comparing salary to position and team."]},{"cell_type":"code","execution_count":4,"id":"289bef79","metadata":{"execution":{"iopub.execute_input":"2024-01-19T00:42:54.084436Z","iopub.status.busy":"2024-01-19T00:42:54.08282Z","iopub.status.idle":"2024-01-19T00:42:54.533052Z","shell.execute_reply":"2024-01-19T00:42:54.531276Z"},"papermill":{"duration":0.460173,"end_time":"2024-01-19T00:42:54.536088","exception":false,"start_time":"2024-01-19T00:42:54.075915","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdeXxM1//H8TNL9n0RW+wqiH2P0oqoNYmltZaq0tIvX0pbil+r1a9QRaiW1tba\nq6pUSKyNpbaipUQFrT2EJETIPjO/P25MI4mYkMzN3Hk9/+gjuffMnY+Z6T3vnHvuGZXBYBAA\nAACwfGq5CwAAAEDxINgBAAAoBMEOAABAIQh2AAAACkGwAwAAUAiCHQAAgEIQ7AAAABSCYAcA\nAKAQBDsAAACFINgBAAAoBMEOAABAIQh2AAAACkGwAwAAUAiCHQAAgEIQ7AAAABSCYAcAAKAQ\nBDsAAACFINgBAAAoBMEOAABAIQh2AAAACkGwAwAAUAiCHQAAgEIQ7AAAABSCYAcAAKAQBDsA\nAACFINgBAAAoBMEOAABAIQh2AAAACkGwAwAAUAiCHQAAgEIQ7AAAABSCYAcAAKAQBDsAAACF\nINgBAAAoBMEOAABAIQh2AAAACkGwAwAAUAiCHQAAgEIQ7AAAABSCYAc8JdVj2Dq4lK/eoMfr\n72+PuSN3jXnFHwk21nkpQyd3OfnpV3/8pn9VHzut1tbeqeV7Rwtpmp12edXcyT1eer5K+TJO\n9lp7J7cKVWq/1OPV2cu3JusMT11B6XyJDgypLZXk4NGhRJ8o/U5kgZ9qtVrt7Obl1yxw1NRF\nl9NL/GUp0rtQOt8yQC4EO6CYZaXfv3nx1M/LZ3VtWGXsmrNyl1P8nm/csH79+vXr1x+0/mLx\nHvnCql4DP1ly5vLtTJ0uKyM15UH241reOrSwSUW/QWPDft518MrNhNQMXUbqvRtXYnf9vOa9\n14Mr+3XYcvl+8dZm5QwGw4N7SeeO7/lqynD/6oH7kjJkKaPkPnuAYmjlLgBQLL0u5YvXmrcJ\nin+5rKPctRSnv06fvpOtF0K4FnfvvuPT/dIPGhuv/q+/7NuiTIHNMu7ubdTuvzcy/x2b0dja\ni6wMnSFnoO7e37+80jDoXPzBynaa4q0QQogHN/b3evGThFNh5n/qkvvsAYrBiB3wrDz9lif8\nK/7cqaPh7+ZcL9Pr7k8Yc1je8ixI7IMs6QfvhotXLvpm+pCaBTY7OGqYlOpUKvXAqd+du3En\nMyMtK+vB2cORIzp