. Finally, we can see from the histogram that the residuals show normality.\n"]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":4319401,"sourceId":7423689,"sourceType":"datasetVersion"}],"dockerImageVersionId":30618,"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":5.691032,"end_time":"2024-01-19T00:42:56.03903","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2024-01-19T00:42:50.347998","version":"2.5.0"}},"nbformat":4,"nbformat_minor":5}